package kr.happyjob.study.mng.model;

import java.util.Date;

public class LectureDto {
	
	private int class_No;
	private String class_Nm;
	private String name;
	private Date class_Startdate;
	private Date class_Enddate;	
	private String class_Type;
	private String class_Obj;
	private String class_Plan;
	private String room_Nm;	
	private int no;
	private int class_Cnt;
	private int class_Totalcnt;
	private String file_name;
	
	public LectureDto() {
		super();
		// TODO Auto-generated constructor stub
	}

	public LectureDto(int class_No, String class_Nm, String name, Date class_Startdate, Date class_Enddate,
			String class_Type, String class_Obj, String class_Plan, String room_Nm, int no, int class_Cnt,
			int class_Totalcnt, String file_name) {
		super();
		this.class_No = class_No;
		this.class_Nm = class_Nm;
		this.name = name;
		this.class_Startdate = class_Startdate;
		this.class_Enddate = class_Enddate;
		this.class_Type = class_Type;
		this.class_Obj = class_Obj;
		this.class_Plan = class_Plan;
		this.room_Nm = room_Nm;
		this.no = no;
		this.class_Cnt = class_Cnt;
		this.class_Totalcnt = class_Totalcnt;
		this.file_name = file_name;
	}

	public int getClass_No() {
		return class_No;
	}

	public void setClass_No(int class_No) {
		this.class_No = class_No;
	}

	public String getClass_Nm() {
		return class_Nm;
	}

	public void setClass_Nm(String class_Nm) {
		this.class_Nm = class_Nm;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public Date getClass_Startdate() {
		return class_Startdate;
	}

	public void setClass_Startdate(Date class_Startdate) {
		this.class_Startdate = class_Startdate;
	}

	public Date getClass_Enddate() {
		return class_Enddate;
	}

	public void setClass_Enddate(Date class_Enddate) {
		this.class_Enddate = class_Enddate;
	}

	public String getClass_Type() {
		return class_Type;
	}

	public void setClass_Type(String class_Type) {
		this.class_Type = class_Type;
	}

	public String getClass_Obj() {
		return class_Obj;
	}

	public void setClass_Obj(String class_Obj) {
		this.class_Obj = class_Obj;
	}

	public String getClass_Plan() {
		return class_Plan;
	}

	public void setClass_Plan(String class_Plan) {
		this.class_Plan = class_Plan;
	}

	public String getRoom_Nm() {
		return room_Nm;
	}

	public void setRoom_Nm(String room_Nm) {
		this.room_Nm = room_Nm;
	}

	public int getNo() {
		return no;
	}

	public void setNo(int no) {
		this.no = no;
	}

	public int getClass_Cnt() {
		return class_Cnt;
	}

	public void setClass_Cnt(int class_Cnt) {
		this.class_Cnt = class_Cnt;
	}

	public int getClass_Totalcnt() {
		return class_Totalcnt;
	}

	public void setClass_Totalcnt(int class_Totalcnt) {
		this.class_Totalcnt = class_Totalcnt;
	}

	public String getFile_name() {
		return file_name;
	}

	public void setFile_name(String file_name) {
		this.file_name = file_name;
	}

	@Override
	public String toString() {
		return "LectureDto [class_No=" + class_No + ", class_Nm=" + class_Nm + ", name=" + name + ", class_Startdate="
				+ class_Startdate + ", class_Enddate=" + class_Enddate + ", class_Type=" + class_Type + ", class_Obj="
				+ class_Obj + ", class_Plan=" + class_Plan + ", room_Nm=" + room_Nm + ", no=" + no + ", class_Cnt="
				+ class_Cnt + ", class_Totalcnt=" + class_Totalcnt + ", file_name=" + file_name + "]";
	}

	
	
}
